function pos(frame) {
    return thisLayer.toWorld(thisLayer.anchorPoint, framesToTime(frame));
}
var result = 0;
if (R > 0) {
    var distance = 0;
    if (curved) {
        var start = thisLayer.inPoint > thisComp.displayStartTime ? timeToFrames(thisLayer.inPoint) : timeToFrames(thisComp.displayStartTime);
        var end = time < thisLayer.outPoint ? timeToFrames(time) : timeToFrames(thisLayer.outPoint);
        for (i = start; i < end; i++) {
            if (sub(pos(sum(i, 1))[0], pos(i)[0]) > 0)
                distance = sum(distance, length(pos(sum(i, 1)), pos(i)));
            else
                distance = sub(distance, length(pos(sum(i, 1)), pos(i)));
        }
    } else {
        distance = pos(timeToFrames(time))[0];
    }
    result = radiansToDegrees(div(distance, R));
}
$bm_rt = Rev == 1 ? sub(value, result) : sum(value, result);

